import styled from 'styled-components';

export const BodyHomeBody = styled.div`
    width:1280px;
    height:1900px;
    margin:auto;
    z-index : 1;
    background-color: rgb(255,255,255);
`;

export const PageBody = styled.div`
    background-color: rgb(255,255,255);
`;

export const Titre2 = styled.h1`
    color: rgb(0, 0, 0);
    z-index : 1;
    text-align: center;
    font-weight: bold;
    font-size: 48px;
    padding: 1cm;
`;

export const Form = styled.form`
    text-align: center;
    font-size: 2em;
`;
